poem:
Was du suchst , wo ist dein Stern nicht ? 
Werd ein Stern in Nacht und Nacht sein ; 
Werd ein Stern in Nacht und Nacht sein ; 
Bis du endlich auf dem Meer warst 
O wie selig bist du mir jetzt !

Die alte Weisheit kann sie ferner lehren , 
Die alte Weisheit kann sie ferner lehren 
Die alte Weisheit kann sie ferner lehren , 
Sie dieses heißt Kein Ding ist unverlierbar . 
Ihr sagt , es sei die Welt wie jedes andre ; 
Ihr sagt , es sei die Welt wie jedes andre ; 
Mitnichten ist sie gänzlich unverlierbar . 
Ihr sagt , es sei die Welt wie jedes andre ; 
Ihr sagt , es sei die Welt wie jedes andre ; 
Ihr sagt , die gleiche Welt wie jedes andre ;
